import React from 'react'

const Employees = ({ employees }) => {
  return (
    <div>
      <center><h1>Employee List</h1></center>
      {employees.map((employee) => (
        <div key={employee.code} className="card">
          <div className="card-body">
            <h5 className="card-title">{employee.name}</h5>
            <h6 className="card-subtitle mb-2 text-muted">{employee.age}</h6>
            <p class="card-text">{employee.address}</p>
            <p class="card-text">{employee.department}</p>
          </div>
        </div>
      ))}
    </div>
  )
};

export default Employees
